import sary from "./fi.jpg";
import "./style.css";

const bool = false;

function Item({ name, isPacked }) {
    return (
        <li className="item">
          {name} {isPacked && '✔'}
        </li>
      );
  }

function Onglet(){
    if(bool){
    return(
        <>
            <nav>
                <ul>
                    <li><a href="#" className="active">Accueil</a></li>
                    <li><a href="#">Blog</a></li>
                    <li><a href="#">Message</a></li>
                    <li><a href="#">Contact</a></li>
                </ul>
            </nav>
        </>
    );
    }
    else{
        return(
            <>
            <nav>
                <ul>
                    <li><a href="#" className="active" onClick={onclick}>Home</a></li>
                    <li><a href="#">Blog Perso</a></li>
                    <li><a href="#">Inbox</a></li>
                    <li><a href="#">Menu</a></li>
                </ul>
            </nav>
        </>
        );
    }
}

function onclick(){
    return(
        alert("Bienvenu")
    );
}
  
  export default function PackingList() {
    return (
      <section>
        <Onglet />
        <h1>Sally Ride's Packing List</h1>
        <ul>
          <Item 
            isPacked={true} 
            name="Space suit" 
          />
          <Item 
            isPacked={true} 
            name="Helmet with a golden leaf" 
          />
          <Item 
            isPacked={false} 
            name="Photo of Tam" 
          />
        </ul>
        <img 
            src={sary}
            className="photo"
            alt="finaritra"
        />
      </section>
    );
  }
